import React from 'react'
import './Footer.css';

export default function Footer() {
  return (
    <div className="Footer">
        <div className="container">
            <div className="footer-wrapper">
                <div className="footer-logo">
                    <h2>Chemistry</h2>
                    <p className="description">Grow with us</p>

                    
                </div>
            </div>
        </div>
    </div>
  )
}
